# Show a popup message depending on type of error
function Show-Popup {
    param (
        [string]$title,
        [string]$message,
        [switch]$isError = $false
    )

    $msgBoxType = if ($isError) { [System.Windows.Forms.MessageBoxIcon]::Error } else { [System.Windows.Forms.MessageBoxIcon]::Information }
    [System.Windows.Forms.MessageBox]::Show($message, $title, [System.Windows.Forms.MessageBoxButtons]::OK, $msgBoxType)
}
# Makes sure that the label "Select your browser" is always centered on the form regardless its size
function Set-BrowserLabelCenter($y) {
    $labelX = [math]::Floor(($form.ClientSize.Width - $browserLabel.Width) / 2)
    $browserLabel.Location = New-Object System.Drawing.Point($labelX, $y)
}
# Makes sure that the form is always centered on screen regardless of the form size
function Center-Form {
    $screenWidth = [System.Windows.Forms.Screen]::PrimaryScreen.WorkingArea.Width
    $screenHeight = [System.Windows.Forms.Screen]::PrimaryScreen.WorkingArea.Height
    $formWidth = [int]$form.Width
    $formHeight = [int]$form.Height

    $newX = [math]::Floor(($screenWidth - $formWidth) / 2)
    $newY = [math]::Floor(($screenHeight - $formHeight) / 2)
    $form.Location = New-Object System.Drawing.Point($newX, $newY)
}
# Makes sure that the browser options are always spread out evenly horizontally regardless of form size
function Center-ControlHorizontally($control, $y) {
    $controlX = [math]::Floor(($form.ClientSize.Width - $control.Width) / 2)
    $control.Location = New-Object System.Drawing.Point($controlX, $y)
}
# This function checks if the system is running a Windows 11 operation system and returns that result 
function Is-Windows11 {
    $osInfo = Get-CimInstance -ClassName Win32_OperatingSystem
    $version = [version]$osInfo.Version
    
    # Windows 11 build numbers start from 22000
    return ($version.Major -eq 10 -and $version.Build -ge 22000)
}
# Checks if Windows is activated by getting querying a license request and return the request result
function Check-ActivationStatus {
    try {
        # Query only the Windows license entry
        $license = Get-CimInstance -Query "SELECT LicenseStatus FROM SoftwareLicensingProduct WHERE ApplicationID = '55c92734-d682-4d71-983e-d6ec3f16059f' AND LicenseStatus = 1" -ErrorAction Stop
        return ($null -ne $license)
    }
    catch {
        Write-Warning "Activation check failed: $_"
        return $false
    }
}
# Checks if the current system is running on Windows 11 and that operating system has been activated
function Check-Operating-System {
    # Checks if the current operation system is Windows 11
    if (-not (Is-Windows11)) {
        Show-Popup -title "Unsupported Operating System" -message "This program can only run on a Windows 11 device." -isError
        exit
    }
    # Checks if the current operation system has been activated
    if (-not (Check-ActivationStatus)) {
        Show-Popup -title "Customize personalisation disabled" -message "This program requires Windows to be activated to customize your personalisation settings."      
    }
    else {
        $isColorCustomizationEnabled.Enabled = $true
    }
}
# Decodes Base64 and load the image
function Get-ImageFromBase64 {
    param (
        [string]$base64
    )
    $bytes = [System.Convert]::FromBase64String($base64)
    $stream = [System.IO.MemoryStream]::new($bytes)
    return [System.Drawing.Image]::FromStream($stream)
}
# Helper function to have a clamping method to clamp the min max values for the colors
function Clamp-Value {
    param(
        [int]$Value,
        [int]$Min,
        [int]$Max
    )
    if ($Value -lt $Min) { return $Min }
    if ($Value -gt $Max) { return $Max }
    return $Value
}
# Color Update Functionality
function Update-Color {
    # Use helper function instead of [Math]::Clamp
    $r = Clamp-Value -Value $redTrackBar.Value -Min 0 -Max 255
    $g = Clamp-Value -Value $greenTrackBar.Value -Min 0 -Max 255
    $b = Clamp-Value -Value $blueTrackBar.Value -Min 0 -Max 255

    # Prevent infinite update loops
    $redTrackBar.SuspendLayout()
    $greenTrackBar.SuspendLayout()
    $blueTrackBar.SuspendLayout()

    # Update controls only if values changed
    if ($redNumeric.Value -ne $r) { $redNumeric.Value = $r }
    if ($greenNumeric.Value -ne $g) { $greenNumeric.Value = $g }
    if ($blueNumeric.Value -ne $b) { $blueNumeric.Value = $b }

    $redTrackBar.ResumeLayout()
    $greenTrackBar.ResumeLayout()
    $blueTrackBar.ResumeLayout()

    # Update color display
    $color = [System.Drawing.Color]::FromArgb($r, $g, $b)
    $Global:SelectedColor = $color.ToArgb()

    $previewPanel.BackColor = $color
    $hexLabel.Text = "#{0:X2}{1:X2}{2:X2}" -f $r, $g, $b
}
# Draws the gradiant color onto the window
function Draw-Gradient {
    param(
        [System.Windows.Forms.Panel]$Panel,
        [System.Drawing.Color]$StartColor,
        [System.Drawing.Color]$EndColor
    )
    $gradientBrush = New-Object System.Drawing.Drawing2D.LinearGradientBrush(
        $Panel.ClientRectangle,
        $StartColor,
        $EndColor,
        [System.Drawing.Drawing2D.LinearGradientMode]::Horizontal
    )
    $Panel.CreateGraphics().FillRectangle($gradientBrush, $Panel.ClientRectangle)
}
# Update Gradient on Color Change
function Update-Gradient {
    $startColor = [System.Drawing.Color]::FromArgb($redTrackBar.Value, $greenTrackBar.Value, $blueTrackBar.Value)
    $endColor = [System.Drawing.Color]::FromArgb(
        (255 - $redTrackBar.Value),
        (255 - $greenTrackBar.Value),
        (255 - $blueTrackBar.Value))
    Draw-Gradient -Panel $gradientPanel -StartColor $startColor -EndColor $endColor
}
# Shows a black overlay to hide the processes
function Show-Overlay($base64Image) {
    # Create synchronized hashtable
    $syncHash = [hashtable]::Synchronized(@{
        ShouldClose = $false
        CurrentImage = $base64Image
        CurrentStatus = "Initializing..."
        Form = $null
        PictureBox = $null
        StatusLabel = $null
        Initialized = $false
        CustomFont = $customFont
    })

    $runspace = [RunspaceFactory]::CreateRunspace()
    $runspace.ApartmentState = "STA"
    $runspace.Open()
    
    $ps = [PowerShell]::Create().AddScript({
        param($sync)
        
        Add-Type -AssemblyName System.Windows.Forms
        Add-Type -AssemblyName System.Drawing

        # Form setup
        $form = New-Object System.Windows.Forms.Form
        $form.FormBorderStyle = "None"
        $form.WindowState = "Maximized"
        $form.BackColor = [System.Drawing.Color]::Black
        $form.TopMost = $true
        $form.Opacity = 1.0
        $form.ShowInTaskbar = $false
        $sync.Form = $form

        # PictureBox setup
        $pictureBox = New-Object System.Windows.Forms.PictureBox
        $pictureBox.Dock = "Fill"
        $pictureBox.SizeMode = "StretchImage"
        $sync.PictureBox = $pictureBox
        $form.Controls.Add($pictureBox)

        # Status Label setup
        $statusLabel = New-Object System.Windows.Forms.Label
        $statusLabel.ForeColor = [System.Drawing.Color]::White
        $statusLabel.BackColor = [System.Drawing.Color]::Transparent
        $statusLabel.Font = $sync.CustomFont
        $statusLabel.AutoSize = $false
        $statusLabel.TextAlign = [System.Windows.Forms.HorizontalAlignment]::Center
        $statusLabel.TextAlign = [System.Drawing.ContentAlignment]::MiddleCenter
        $statusLabel.Dock = [System.Windows.Forms.DockStyle]::Bottom
        $statusLabel.Height = 60
        $statusLabel.Text = $sync.CurrentStatus
        $sync.StatusLabel = $statusLabel
        $form.Controls.Add($statusLabel)

        # Initial image load
        $imageBytes = [Convert]::FromBase64String($sync.CurrentImage)
        $pictureBox.Image = [System.Drawing.Image]::FromStream(
            (New-Object System.IO.MemoryStream($imageBytes, 0, $imageBytes.Length)))

        # Mark as initialized
        $sync.Initialized = $true

        # Timer for updates and closure
        $timer = New-Object System.Windows.Forms.Timer
        $timer.Interval = 100
        $timer.Add_Tick({
            if ($sync.ShouldClose) {
                $form.Close()
            }
            # Check for image updates
            if ($sync.CurrentImage -ne $null) {
                $imageBytes = [Convert]::FromBase64String($sync.CurrentImage)
                $newImage = [System.Drawing.Image]::FromStream(
                    (New-Object System.IO.MemoryStream($imageBytes, 0, $imageBytes.Length)))
                $pictureBox.Image.Dispose()
                $pictureBox.Image = $newImage
                $sync.CurrentImage = $null
            }
            # Update status text
            if ($sync.CurrentStatus -ne $null -and $statusLabel.Text -ne $sync.CurrentStatus) {
                $statusLabel.Text = $sync.CurrentStatus
            }
        })
        $timer.Start()

        # Show form
        $form.Show()
        [System.Windows.Forms.Application]::Run($form)

        # Cleanup
        $timer.Dispose()
        $pictureBox.Image.Dispose()
        $form.Dispose()
    }).AddArgument($syncHash)

    $ps.Runspace = $runspace
    $handle = $ps.BeginInvoke()

    # Wait for initialization
    while (-not $syncHash.Initialized -and -not $handle.IsCompleted) {
        Start-Sleep -Milliseconds 100
    }

    return @{
        PowerShell = $ps
        Runspace = $runspace
        Handle = $handle
        SyncHash = $syncHash
    }
}
# Removes Outlook and OneDrive from your system
function Remove-OutlookAndOneDrive {
    try {
        Set-ExecutionPolicy Bypass -Scope Process -Force
        $ErrorActionPreference = 'SilentlyContinue'

        # Close Outlook processes before removal
        Get-Process | Where-Object { $_.ProcessName -like "*outlook*" } | Stop-Process -Force
        Start-Sleep -Seconds 2

        # Remove Outlook via External PowerShell Process (Fixes EXE execution issues)
        Write-Host "Removing Outlook..." -ForegroundColor Cyan
        Start-Process -FilePath "powershell.exe" -ArgumentList "-Command `"Get-AppxPackage -AllUsers *Outlook* | Remove-AppxPackage -AllUsers`"" -WindowStyle Hidden -Wait

        # Remove Outlook folders with proper permissions
        $windowsAppsPath = "C:\Program Files\WindowsApps"
        if (Test-Path $windowsAppsPath) {
            $outlookFolders = Get-ChildItem -Path $windowsAppsPath -Directory | Where-Object { $_.Name -like "Microsoft.OutlookForWindows*" }
            foreach ($folder in $outlookFolders) {
                $folderPath = Join-Path $windowsAppsPath $folder.Name
                takeown /f $folderPath /r /d Y | Out-Null
                icacls $folderPath /grant administrators:F /t | Out-Null
                Remove-Item -Path $folderPath -Recurse -Force
            }
        }

        # Remove Outlook shortcuts
        $shortcutPaths = @(
            "$env:ProgramData\Microsoft\Windows\Start Menu\Programs\Outlook.lnk",
            "$env:APPDATA\Microsoft\Windows\Start Menu\Programs\Outlook.lnk",
            "$env:ProgramData\Microsoft\Windows\Start Menu\Programs\Microsoft Office\Outlook.lnk",
            "$env:APPDATA\Microsoft\Windows\Start Menu\Programs\Microsoft Office\Outlook.lnk",
            "$env:PUBLIC\Desktop\Outlook.lnk",
            "$env:USERPROFILE\Desktop\Outlook.lnk",
            "$env:PUBLIC\Desktop\Microsoft Outlook.lnk",
            "$env:USERPROFILE\Desktop\Microsoft Outlook.lnk",
            "$env:PUBLIC\Desktop\Outlook (New).lnk",
            "$env:USERPROFILE\Desktop\Outlook (New).lnk",
            "$env:ProgramData\Microsoft\Windows\Start Menu\Programs\Outlook (New).lnk",
            "$env:APPDATA\Microsoft\Windows\Start Menu\Programs\Outlook (New).lnk"
        )
        $shortcutPaths | ForEach-Object { if (Test-Path $_) { Remove-Item $_ -Force } }

        # Taskbar cleanup
        Set-ItemProperty -Path "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\Advanced" -Name "ShowTaskViewButton" -Value 0 -Type DWord -Force

        $registryPaths = @(
            "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\Taskband",
            "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\TaskbarMRU",
            "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\TaskBar",
            "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\Advanced"
        )
        foreach ($path in $registryPaths) {
            if (Test-Path $path) {
                @("Favorites", "FavoritesResolve", "FavoritesChanges", "FavoritesRemovedChanges", "TaskbarWinXP", "PinnedItems") | 
                ForEach-Object { Remove-ItemProperty -Path $path -Name $_ -ErrorAction SilentlyContinue }
            }
        }

        Remove-Item "$env:LOCALAPPDATA\Microsoft\Windows\Shell\LayoutModification.xml" -Force -ErrorAction SilentlyContinue
        Remove-Item "$env:LOCALAPPDATA\Microsoft\Windows\Explorer\iconcache*" -Force -ErrorAction SilentlyContinue
        Remove-Item "$env:LOCALAPPDATA\Microsoft\Windows\Explorer\thumbcache*" -Force -ErrorAction SilentlyContinue

        # OneDrive Removal (Run externally to avoid EXE execution issues)
        Write-Host "Checking for OneDrive installation..." -ForegroundColor Cyan

        # Ensure OneDrive processes are stopped before uninstall
        Get-Process onedrive -ErrorAction SilentlyContinue | Stop-Process -Force -ErrorAction SilentlyContinue

        # Find OneDrive uninstallers
        $OneDriveSetupPaths = @(
            "$env:SystemRoot\SysWOW64\OneDriveSetup.exe",
            "$env:SystemRoot\System32\OneDriveSetup.exe"
        )

        $OneDriveFound = $false

        foreach ($OneDriveSetup in $OneDriveSetupPaths) {
            if (Test-Path $OneDriveSetup) {
                Write-Host "Uninstalling OneDrive using: $OneDriveSetup" -ForegroundColor Cyan
                Start-Process -FilePath $OneDriveSetup -ArgumentList "/uninstall" -NoNewWindow -Wait
                $OneDriveFound = $true
                break
            }
        }

        # Backup uninstall method: Use winget if OneDriveSetup.exe is missing
        if (-not $OneDriveFound) {
            Write-Host "OneDriveSetup.exe not found! Trying winget..." -ForegroundColor Cyan
            Start-Process -FilePath "powershell.exe" -ArgumentList "-Command `"winget uninstall Microsoft.OneDrive -h`"" -NoNewWindow -Wait
        }

        # Clean up leftover OneDrive files
        Write-Host "Cleaning up OneDrive leftovers..." -ForegroundColor Cyan
        @(
            "$env:USERPROFILE\OneDrive",
            "$env:LOCALAPPDATA\Microsoft\OneDrive",
            "$env:PROGRAMDATA\Microsoft OneDrive",
            "$env:SystemDrive\OneDriveTemp"
        ) | ForEach-Object { if (Test-Path $_) { Remove-Item $_ -Recurse -Force -ErrorAction SilentlyContinue } }

        # Remove OneDrive from Registry
        Write-Host "Removing OneDrive from registry..." -ForegroundColor Cyan
        @(
            "HKCR:\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}",
            "HKCR:\Wow6432Node\CLSID\{018D5C66-4533-4307-9B53-224DE2ED1FE6}",
            "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\Desktop\NameSpace\{018D5C66-4533-4307-9B53-224DE2ED1FE6}"
        ) | ForEach-Object { if (Test-Path $_) { Remove-Item -Path $_ -Recurse -Force -ErrorAction SilentlyContinue } }

        # Restart Explorer to Apply Changes
        Get-Process explorer | Stop-Process -Force
        Start-Sleep -Seconds 2
        Start-Process explorer

        Write-Host "Outlook and OneDrive successfully removed!" -ForegroundColor Green
        $global:overlayForm.SyncHash.CurrentStatus = "Outlook and OneDrive successfully removed."
        Start-Sleep -Seconds 2
    }
    catch {
        Write-Host "Unexpected error: $_" -ForegroundColor Red
    }
}
# Removes Edge from your system and creates protected folders to prevent Edge from reinstalling
function Remove-Edge{
        Write-Host "=== Microsoft Edge Removal Process ===" -ForegroundColor Yellow
    Write-Host "Starting comprehensive Edge removal..." -ForegroundColor Cyan

    # ===== 1. Remove Edge from Startup =====
    Write-Host "`n[1/6] Removing Edge from Windows startup..." -ForegroundColor Green
    
    # Registry Cleanup
    $regPaths = @(
        "HKCU:\Software\Microsoft\Windows\CurrentVersion\Run",
        "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Run", 
        "HKCU:\Software\Microsoft\Windows\CurrentVersion\Explorer\StartupApproved\Run"
    )

    foreach ($path in $regPaths) {
        try {
            Get-Item -Path $path -ErrorAction Stop | 
            Select-Object -ExpandProperty Property |
            Where-Object { $_ -match 'Edge|MsEdge' } |
            ForEach-Object {
                Remove-ItemProperty -Path $path -Name $_ -Force -ErrorAction SilentlyContinue
                Write-Host "  Removed startup registry entry: $path\$_" -ForegroundColor Cyan
            }
        } catch {
            Write-Host "  Could not access registry path: $path" -ForegroundColor DarkYellow
        }
    }

    # Scheduled Task Disable
    try {
        $edgeTasks = Get-ScheduledTask -TaskPath "\Microsoft\Edge\" -ErrorAction Stop | 
                    Where-Object { $_.TaskName -match 'Edge' }
        if ($edgeTasks) {
            $edgeTasks | Disable-ScheduledTask -ErrorAction SilentlyContinue
            Write-Host "  Disabled $($edgeTasks.Count) Edge scheduled tasks" -ForegroundColor Cyan
        }
    } catch {
        Write-Host "  No Edge scheduled tasks found or access denied" -ForegroundColor DarkYellow
    }

    # Startup Folder Cleanup
    $startupFolders = @(
        "$env:APPDATA\Microsoft\Windows\Start Menu\Programs\Startup",
        "$env:ProgramData\Microsoft\Windows\Start Menu\Programs\StartUp"
    )
    
    $startupFolders | ForEach-Object {
        Get-ChildItem $_ -Filter "*Edge*" -ErrorAction SilentlyContinue |
        ForEach-Object {
            Remove-Item -Path $_.FullName -Force -ErrorAction SilentlyContinue
            Write-Host "  Removed startup shortcut: $($_.FullName)" -ForegroundColor Cyan
        }
    }

    # ===== 2. Terminate Edge Processes =====
    Write-Host "`n[2/6] Terminating Edge processes..." -ForegroundColor Green
    $processes = Get-Process -Name "*edge*" -ErrorAction SilentlyContinue
    if ($processes) {
        $processes | ForEach-Object {
            try {
                Stop-Process -Id $_.Id -Force -ErrorAction Stop
                Write-Host "  Terminated process: $($_.Name) (PID: $($_.Id))" -ForegroundColor Cyan
            } catch {
                Write-Host "  Failed to terminate $($_.Name) (PID: $($_.Id)): $_" -ForegroundColor Red
            }
        }
    } else {
        Write-Host "  No running Edge processes found." -ForegroundColor Cyan
    }

    # ===== 3. Uninstall Edge =====
    Write-Host "`n[3/6] Uninstalling Edge components..." -ForegroundColor Green
    
    # Uninstall using setup.exe
    $setupPaths = Get-ChildItem -Path "${env:ProgramFiles(x86)}\Microsoft\Edge\Application" -Recurse -Filter "setup.exe" -ErrorAction SilentlyContinue
    if ($setupPaths) {
        foreach ($setupPath in $setupPaths) {
            try {
                Write-Host "  Running uninstaller: $($setupPath.FullName)" -ForegroundColor Cyan
                $uninstallArgs = "--uninstall --system-level --verbose-logging --force-uninstall"
                Start-Process -FilePath $setupPath.FullName -ArgumentList $uninstallArgs -Wait -NoNewWindow
                Write-Host "  Uninstallation completed for: $($setupPath.FullName)" -ForegroundColor Green
            } catch {
                Write-Host "  Failed to uninstall Edge from $($setupPath.FullName): $_" -ForegroundColor Red
            }
        }
    } else {
        Write-Host "  No Edge setup.exe found." -ForegroundColor Yellow
    }

    # ===== 4. Clean Files and Shortcuts =====
    Write-Host "`n[4/6] Cleaning Edge files and shortcuts..." -ForegroundColor Green
    
    # Remove Start Menu shortcuts
    $shortcutLocations = @(
        "$env:ProgramData\Microsoft\Windows\Start Menu\Programs\Microsoft Edge.lnk",
        "$env:APPDATA\Microsoft\Windows\Start Menu\Programs\Microsoft Edge.lnk",
        "$env:ALLUSERSPROFILE\Microsoft\Windows\Start Menu\Programs\Microsoft Edge.lnk",
        "$env:PUBLIC\Desktop\Microsoft Edge.lnk"
    )
    
    foreach ($path in $shortcutLocations) {
        if (Test-Path $path) {
            try {
                Remove-Item -Path $path -Force -ErrorAction Stop
                Write-Host "  Deleted shortcut: $path" -ForegroundColor Green
            } catch {
                Write-Host "  Failed to delete shortcut: $path ($_)" -ForegroundColor Red
            }
        }
    }

    # Remove Edge folders
    $edgeFolders = @(
        "$env:LOCALAPPDATA\Microsoft\Edge",
        "$env:PROGRAMFILES\Microsoft\Edge",
        "${env:ProgramFiles(x86)}\Microsoft\Edge",
        "${env:ProgramFiles(x86)}\Microsoft\EdgeUpdate",
        "${env:ProgramFiles(x86)}\Microsoft\EdgeCore",
        "$env:LOCALAPPDATA\Microsoft\EdgeUpdate",
        "$env:PROGRAMDATA\Microsoft\EdgeUpdate"
    )
    
    foreach ($path in $edgeFolders) {
        if (Test-Path $path) {
            Write-Host "  Cleaning folder: $path" -ForegroundColor Cyan
            try {
                # Take ownership and set permissions
                if ((Get-Item $path).PSIsContainer) {
                    takeown /F $path /R /D Y | Out-Null
                    icacls $path /grant administrators:F /T | Out-Null
                }
                
                Remove-Item -Path $path -Recurse -Force -ErrorAction Stop
                Write-Host "  Successfully removed: $path" -ForegroundColor Green
            } catch {
                Write-Host "  Failed to remove: $path ($_)" -ForegroundColor Red
            }
        }
    }

    # ===== 5. Clean Registry =====
    Write-Host "`n[5/6] Cleaning Edge registry entries..." -ForegroundColor Green
    
    $regKeys = @(
        "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Uninstall\Microsoft Edge",
        "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Uninstall\Microsoft Edge Update",
        "HKLM:\SOFTWARE\Microsoft\EdgeUpdate",
        "HKCU:\Software\Microsoft\Edge",
        "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\App Paths\msedge.exe",
        "HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\Uninstall\Microsoft EdgeUpdate",
        "HKLM:\SOFTWARE\WOW6432Node\Microsoft\Windows\CurrentVersion\Uninstall\Microsoft EdgeUpdate",
        "HKLM:\SOFTWARE\Microsoft\Edge",
        "HKLM:\SOFTWARE\WOW6432Node\Microsoft\Edge",
        "HKLM:\SOFTWARE\WOW6432Node\Microsoft\EdgeUpdate",
        "HKLM:\SOFTWARE\WOW6432Node\Microsoft\Windows\CurrentVersion\Uninstall\Microsoft Edge",
        "HKLM:\SOFTWARE\WOW6432Node\Microsoft\Windows\CurrentVersion\Uninstall\Microsoft Edge Update"
    )
    
    foreach ($key in $regKeys) {
        if (Test-Path $key) {
            try {
                Remove-Item -Path $key -Recurse -Force -ErrorAction Stop
                Write-Host "  Deleted registry key: $key" -ForegroundColor Green
            } catch {
                Write-Host "  Failed to delete registry key: $key ($_)" -ForegroundColor Red
            }
        }
    }

    # ===== 6. Remove Services and Final Cleanup =====
    Write-Host "`n[6/6] Final cleanup..." -ForegroundColor Green
    
    # Remove EdgeUpdate services
    $services = @(
        "edgeupdate",
        "edgeupdatem",
        "MicrosoftEdgeElevationService"
    )
    
    foreach ($service in $services) {
        try {
            Write-Host "  Removing service: $service" -ForegroundColor Cyan
            Stop-Service -Name $service -Force -ErrorAction SilentlyContinue
            & sc.exe delete $service | Out-Null
            Write-Host "  Successfully removed service: $service" -ForegroundColor Green
        } catch {
            Write-Host "  Failed to remove service $service : $_" -ForegroundColor Red
        }
    }

    # Force uninstall EdgeUpdate if still exists
    $edgeUpdatePath = "${env:ProgramFiles(x86)}\Microsoft\EdgeUpdate\MicrosoftEdgeUpdate.exe"
    if (Test-Path $edgeUpdatePath) {
        try {
            Write-Host "  Running EdgeUpdate uninstaller..." -ForegroundColor Cyan
            Start-Process -FilePath $edgeUpdatePath -ArgumentList "/uninstall" -Wait -NoNewWindow
            Write-Host "  EdgeUpdate uninstalled." -ForegroundColor Green
        } catch {
            Write-Host "  Failed to uninstall EdgeUpdate: $_" -ForegroundColor Red
        }
    }

    # Restart Explorer to apply changes
    try {
        Write-Host "  Restarting Explorer..." -ForegroundColor Cyan
        Stop-Process -Name explorer -Force -ErrorAction SilentlyContinue
        Start-Process explorer -WindowStyle Hidden
    } catch {
        Write-Host "  Failed to restart Explorer: $_" -ForegroundColor Red
    }

    # ===== 7. Create Protective Folders =====
    Write-Host "`nCreating protective folders to prevent reinstallation..." -ForegroundColor Green
    
    $protectiveFolders = @(
        @{
            Base = "${env:ProgramFiles(x86)}\Microsoft\Edge"
            App = "${env:ProgramFiles(x86)}\Microsoft\Edge\Application"
            CreateSubFolder = $true
        },
        @{
            Base = "${env:ProgramFiles(x86)}\Microsoft\EdgeCore"
            CreateSubFolder = $false
        }
    )
    
    foreach ($folder in $protectiveFolders) {
        try {
            # Create base folder
            if (-not (Test-Path $folder.Base)) {
                New-Item -Path $folder.Base -ItemType Directory -Force | Out-Null
                Write-Host "  Created protective folder: $($folder.Base)" -ForegroundColor Cyan
            }

            # Create application subfolder if needed
            if ($folder.CreateSubFolder -and -not (Test-Path $folder.App)) {
                New-Item -Path $folder.App -ItemType Directory -Force | Out-Null
                Write-Host "  Created protective subfolder: $($folder.App)" -ForegroundColor Cyan
            }

            # Set restrictive permissions
            $currentUser = [System.Security.Principal.WindowsIdentity]::GetCurrent().Name
            $acl = New-Object System.Security.AccessControl.DirectorySecurity
            
            # Set ownership
            $acl.SetOwner([System.Security.Principal.NTAccount]$currentUser)
            
            # Disable inheritance and clear all permissions
            $acl.SetAccessRuleProtection($true, $false)
            
            # Add full control for current user
            $accessRule = New-Object System.Security.AccessControl.FileSystemAccessRule(
                $currentUser, 
                "FullControl,TakeOwnership,ChangePermissions", 
                "ContainerInherit,ObjectInherit",
                "None",
                "Allow"
            )
            $acl.AddAccessRule($accessRule)
            
            # Block critical system accounts
            $denyAccounts = @(
                [System.Security.Principal.SecurityIdentifier]::new("S-1-5-18"),        # SYSTEM
                [System.Security.Principal.SecurityIdentifier]::new("S-1-5-32-544"),    # Administrators
                [System.Security.Principal.SecurityIdentifier]::new("S-1-5-80-956008885-3418522649-1831038044-1853292631-2271478464"), # TrustedInstaller
                [System.Security.Principal.SecurityIdentifier]::new("S-1-5-11")          # Authenticated Users
            )
            
            foreach ($account in $denyAccounts) {
                $denyRule = New-Object System.Security.AccessControl.FileSystemAccessRule(
                    $account,
                    "TakeOwnership,ChangePermissions",
                    "ContainerInherit,ObjectInherit",
                    "None",
                    "Deny"
                )
                $acl.AddAccessRule($denyRule)
            }
            
            # Apply permissions recursively
            if ($folder.CreateSubFolder) {
                Get-ChildItem -Path $folder.Base -Recurse | ForEach-Object {
                    Set-Acl -Path $_.FullName -AclObject $acl -ErrorAction SilentlyContinue
                }
            } else {
                Set-Acl -Path $folder.Base -AclObject $acl -ErrorAction Stop
            }
            
            Write-Host "  Applied protective permissions to: $($folder.Base)" -ForegroundColor Green
        } catch {
            Write-Host "  Failed to secure $($folder.Base): $_" -ForegroundColor Red
        }
    }

    # Completion
    Write-Host "`n=== Microsoft Edge removal completed successfully ===" -ForegroundColor Green
    Write-Host "All Edge components have been removed and protective measures applied." -ForegroundColor Cyan  
    $global:overlayForm.SyncHash.CurrentStatus = "Microsoft Edge succesfully removed."
    Start-Sleep -Seconds 2
}
# Installs the preferred browser that has been selected and creates a shortcut for it if it doesn't exist already
function Install-Browser {
    param (
        [PSObject]$browser
    )

    $global:overlayForm.SyncHash.CurrentStatus = "Installing $($browser.Name)..."

    # Gets the browser executable path based on the selected browser
    $exePath = $exePaths | Where-Object { $_.Name -eq $browser.Name }
    if (-not $exePath -or -not $browser.Name) {
        Write-Host "Unsupported browser name: $($browser.Name)" -ForegroundColor Red
        return
    }

    Write-Host "Checking if $($browser.Name) is already installed." -ForegroundColor Yellow
    if (Test-Path $exePath.Path) {
        Write-Host "$($browser.Name) is already installed at $($exePath.Path). Skipping installation." -ForegroundColor Green
        $global:overlayForm.SyncHash.CurrentStatus = "$($browser.Name) is already installed. Skipping installation."
        Start-Sleep -Seconds 2
        return
    }

    Write-Host "$($browser.Name) not found. Installing Chocolatey..." -ForegroundColor Cyan

    # Install Chocolatey if it's not installed
    if (-not (Get-Command choco -ErrorAction SilentlyContinue)) {
        Write-Host "Chocolatey not found. Installing Chocolatey..." -ForegroundColor Cyan
        Set-ExecutionPolicy Bypass -Scope Process -Force
        Invoke-Expression (New-Object System.Net.WebClient).DownloadString('https://community.chocolatey.org/install.ps1')
    }

    # Check if the browser exists in the Chocolatey repository before installation
    $availablePackages = choco search $browser.ID --all
    if ($availablePackages -match $browser.ID) {
        Write-Host "Installing $($browser.Name) using Chocolatey..." -ForegroundColor Cyan
        choco install $browser.ID -y --ignore-checksums --source=chocolatey
    } else {
        Write-Host "Package $($browser.Name) not found in the Chocolatey repository." -ForegroundColor Red
        return
    }
    # Check if the browser was installed successfully before attempting to create a shortcut for it
    if (Test-Path $exePath.Path) {
        Write-Host "Successfully installed $($browser.Name)" -ForegroundColor Green
        $global:overlayForm.SyncHash.CurrentStatus = "$($browser.Name) is succesfully installed. Creating shortcut..."
        Start-Sleep -Seconds 2
        Create-DesktopShortcut -exePath $exePath
    } else {
        Write-Host "Failed to install $($browser.Name)" -ForegroundColor Red
        return
    }
}
# Creates a desktop shortcut for the preferred browser
function Create-DesktopShortcut {
    param (
        [PSObject]$exePath
    )

    # Define potential shortcut locations
    $desktopPaths = @(
        [Environment]::GetFolderPath("Desktop")        # Current user desktop
        [Environment]::GetFolderPath("CommonDesktop")  # Public desktop
    )

    # Check's if the path exists
    if (-not $exePath -or -not (Test-Path $exePath.Path)) {
        Write-Host "Could not find $($browser.Name) executable" -ForegroundColor DarkYellow
        return
    }

    # Browser-specific shortcut patterns to check
    $shortcutPatterns = switch ($exePath.Name) {
        "Google Chrome"    { @("*Chrome*", "*Google Chrome*") }
        "Brave"      { @("*Brave*", "*Brave Browser*") }
        "Firefox"  { @("*Firefox*", "*Mozilla Firefox*") }
        "LibreWolf" { @("*LibreWolf*", "*Libre Wolf*") }
        default           { @("*$browserName*") }
    }

    # Check for existing shortcuts using patterns
    $existingShortcuts = $desktopPaths | ForEach-Object {
        $desktopPath = $_
        $shortcutPatterns | ForEach-Object {
            Get-ChildItem -Path $desktopPath -Filter $_ -ErrorAction SilentlyContinue
        }
    } | Where-Object { $_.Extension -eq ".lnk" }

    if ($existingShortcuts) {
        Write-Host "Existing shortcut(s) found for $($exePath.Name) :" -ForegroundColor DarkCyan
        $existingShortcuts | ForEach-Object { 
            Write-Host " - $($_.Name)" -ForegroundColor DarkCyan 
        }
        $global:overlayForm.SyncHash.CurrentStatus = "$($browser.Name) shortcut already exists. Skipping creating the shortcut."
        Start-Sleep -Seconds 4
        return
    }

    # Create new shortcut only in current user desktop
    try {
        $userDesktop = [Environment]::GetFolderPath("Desktop")
        $shortcutPath = Join-Path $userDesktop "$($exePath.Name).lnk"
        
        $WshShell = New-Object -ComObject WScript.Shell
        $Shortcut = $WshShell.CreateShortcut($shortcutPath)
        $Shortcut.TargetPath = $exePath.Path
        $Shortcut.Save()
        Write-Host "Created user desktop shortcut: $shortcutPath" -ForegroundColor Cyan
        $global:overlayForm.SyncHash.CurrentStatus = "$($browser.Name) shortcut successfully created."
        Start-Sleep -Seconds 2
    } catch {
        Write-Host "Failed to create shortcut: $_" -ForegroundColor DarkYellow
    }
}
# Restored the Windows layout to the Windows 10 layout and set the theme to dark mode
function Set-WindowsClassicLayoutAndDarkMode {
    param (
        [PSObject]$browser
    )
     # Registry modifications
    $registryModifications = @(
        # Visual changes
        @{ RootKey = "HKCU"; KeyPath = "Software\Microsoft\Windows\CurrentVersion\Explorer\Advanced"; ValueName = "TaskbarAl"; ValueType = "DWord"; Value = 0 }, # Align taskbar to the left
        @{ RootKey = "HKCU"; KeyPath = "Software\Microsoft\Windows\CurrentVersion\Explorer\Advanced"; ValueName = "ShowTaskViewButton"; ValueType = "DWord"; Value = 0 }, # Hides task view button
        @{ Rootkey = "HKCU"; KeyPath = "Software\Microsoft\Windows\CurrentVersion\Themes\Personalize"; ValueName = "SystemUsesLightTheme"; ValueType = "DWord"; Value = 0 } # Set Windows system to dark theme
        @{ RootKey = "HKCU"; KeyPath = "Software\Microsoft\Windows\CurrentVersion\Themes\Personalize"; ValueName = "AppsUseLightTheme"; ValueType = "DWord"; Value = 0 }, # Set Windows apps to dark theme
        @{ RootKey = "HKCU"; KeyPath = "Software\Microsoft\Windows\CurrentVersion\Themes\Personalize"; ValueName = "SystemUsesLightTheme"; ValueType = "DWord"; Value = 0 }, # Set Windows to dark theme
        @{ RootKey = "HKCU"; KeyPath = "Software\Microsoft\Windows\CurrentVersion\GameDVR"; ValueName = "AppCaptureEnabled"; ValueType = "DWord"; Value = 0 }, # Fix the "Get an app for 'ms-gamingoverlay'" popup
        @{ RootKey = "HKLM"; KeyPath = "SOFTWARE\Microsoft\PolicyManager\default\ApplicationManagement\AllowGameDVR"; ValueName = "Value"; ValueType = "DWord"; Value = 0 }, # Disable Game DVR (Reduces FPS Drops)
        @{ RootKey = "HKCU"; KeyPath = "Control Panel\Desktop"; ValueName = "MenuShowDelay"; ValueType = "String"; Value = "0" }, # Reduce menu delay for snappier UI
        @{ RootKey = "HKCU"; KeyPath = "Control Panel\Desktop\WindowMetrics"; ValueName = "MinAnimate"; ValueType = "DWord"; Value = 0 }, # Disable minimize/maximize animations
        @{ RootKey = "HKCU"; KeyPath = "Software\Microsoft\Windows\CurrentVersion\Explorer\Advanced"; ValueName = "ExtendedUIHoverTime"; ValueType = "DWord"; Value = 1 }, # Reduce hover time for tooltips and UI elements
        @{ RootKey = "HKCU"; KeyPath = "Software\Microsoft\Windows\CurrentVersion\Explorer\Advanced"; ValueName = "HideFileExt"; ValueType = "DWord"; Value = 0 }, # Show file extensions in Explorer
        @{ RootKey = "HKLM"; KeyPath = "SOFTWARE\Microsoft\EdgeUpdate"; ValueName = "DoNotUpdateToEdgeWithChromium"; ValueType = "DWord"; Value = 1 }, # Prevents Edge update from executing
        @{ RootKey = "HKLM"; KeyPath = "SOFTWARE\Policies\Microsoft\Edge"; ValueName = "InstallationEnabled"; ValueType = "DWord"; Value = 0 } # Disabled Edge from installing
    )

    # Gets the exe path and sets it as the backup value in case the shortcut cannot be found
    $exePath = $exePaths | Where-Object { $_.Name -eq $browser.Name }
    $pinPath = $exePath.Path

    # This looks for the corresponding shortcut on the different kind of desktops. 
    # If a match is found it will set the pin path to the shortcut path
    # Otherwise it will fall back to the default executable path
    $desktopLocations = @(
        [Environment]::GetFolderPath("Desktop")       # Current user desktop
        [Environment]::GetFolderPath("CommonDesktop") # Public desktop
    )

    foreach ($desktopPath in $desktopLocations) {
        $shortcutPath = Join-Path $desktopPath "$($browser.Name).lnk"
        Write-Host "Checking for shortcut at: $shortcutPath" -ForegroundColor Cyan
        
        if (Test-Path $shortcutPath) {
            $pinPath = $shortcutPath
            Write-Host "Found shortcut at: $shortcutPath" -ForegroundColor Green
            break  # Stops searching once we find a valid shortcut
        }
    }

    if ($pinPath -eq $exePath) {
        Write-Host "No desktop shortcut found in any location. Using executable path." -ForegroundColor Yellow
    }

    # Apply registry modifications
    try {
        foreach ($mod in $registryModifications) {
            $rootKey = $mod.RootKey
            $keyPath = $mod.KeyPath
            $valueName = $mod.ValueName
            $valueType = $mod.ValueType
            $value = $mod.Value

            try {
                # Create or modify the registry key
                if ($rootKey -eq "HKCU") {
                    $regRoot = [Microsoft.Win32.Registry]::CurrentUser
                } elseif ($rootKey -eq "HKLM") {
                    $regRoot = [Microsoft.Win32.Registry]::LocalMachine
                } else {
                    throw "Unsupported root key: $rootKey"
                }

                # Open or create the registry key
                $key = $regRoot.OpenSubKey($keyPath, $true)
                if ($key -eq $null) {
                    $key = $regRoot.CreateSubKey($keyPath)
                }

                # Set the registry value
                $key.SetValue($valueName, $value, $valueType)
                $key.Close()

                Write-Host "Applied $valueName to $keyPath" -ForegroundColor Cyan
        } catch {
            Write-Host ("Failed to modify " + $valueName + " in " + $keyPath + ": " + $_) -ForegroundColor Red
        }
    }
    # Create registry entries to mimic Group Policy that hides the Widgets in the taskbar
    reg add "HKLM\SOFTWARE\Policies\Microsoft\Dsh" /v "AllowNewsAndInterests" /t REG_DWORD /d 0 /f
    # Disables the "Learn more about this picture" shortcut on your desktop. A re-signin is needed to see the effect
    reg add "HKLM\SOFTWARE\Policies\Microsoft\Windows\Windows Feeds" /v "EnableFeeds" /t REG_DWORD /d 0 /f
    reg add "HKCU\Software\Microsoft\Windows\CurrentVersion\Explorer\HideDesktopIcons\NewStartPanel" /v "{2cc5ca98-6485-489a-920e-b3e88a6ccce3}" /t REG_DWORD /d 1 /f
    
    # Pin File Explorer to Taskbar
    try {
        Write-Host "Pinning File Explorer to Taskbar..." -ForegroundColor Cyan
        # Credits go to letsdoautomation on github for coming up with this script
        # https://github.com/letsdoautomation
        # https://github.com/letsdoautomation/powershell/blob/main/Windows%2011%20pin%20software%20to%20taskbar/README.md
        # Create an XML configuration file to define the taskbar layout
        # This XML will replace the current taskbar layout (PinListPlacement="Replace")
        # Current configuration only pins File Explorer, but can be expanded with other apps
        # You can use the command "Get-AppxPackage | select @{n='name';e={"$($_.PackageFamilyName)!app"}} | ?{$_.name -like "**"}"
        # to see all the packages you currently have installed along with its ID that you can use to attach it to the taskbar
        $taskbar_layout =
@"
<?xml version="1.0" encoding="utf-8"?>
<LayoutModificationTemplate
    xmlns="http://schemas.microsoft.com/Start/2014/LayoutModification"
    xmlns:defaultlayout="http://schemas.microsoft.com/Start/2014/FullDefaultLayout"
    xmlns:start="http://schemas.microsoft.com/Start/2014/StartLayout"
    xmlns:taskbar="http://schemas.microsoft.com/Start/2014/TaskbarLayout"
    Version="1">
  <CustomTaskbarLayoutCollection PinListPlacement="Replace">
    <defaultlayout:TaskbarLayout>
      <taskbar:TaskbarPinList>
        <taskbar:DesktopApp DesktopApplicationID="Microsoft.Windows.Explorer" />
        <taskbar:DesktopApp DesktopApplicationLinkPath="$pinPath" />
      </taskbar:TaskbarPinList>
    </defaultlayout:TaskbarLayout>
 </CustomTaskbarLayoutCollection>
</LayoutModificationTemplate>
"@

        # prepare provisioning folder
        [System.IO.FileInfo]$provisioning = "$($env:ProgramData)\provisioning\tasbar_layout.xml"
        if (!$provisioning.Directory.Exists) {
            $provisioning.Directory.Create()
        }

        $taskbar_layout | Out-File $provisioning.FullName -Encoding utf8

        $settings = [PSCustomObject]@{
            Path  = "SOFTWARE\Policies\Microsoft\Windows\Explorer"
            Value = $provisioning.FullName
            Name  = "StartLayoutFile"
            Type  = [Microsoft.Win32.RegistryValueKind]::ExpandString
        },
        [PSCustomObject]@{
            Path  = "SOFTWARE\Policies\Microsoft\Windows\Explorer"
            Value = 1
            Name  = "LockedStartLayout"
        } | group Path

        foreach ($setting in $settings) {
            $registry = [Microsoft.Win32.Registry]::LocalMachine.OpenSubKey($setting.Name, $true)
            if ($null -eq $registry) {
                $registry = [Microsoft.Win32.Registry]::LocalMachine.CreateSubKey($setting.Name, $true)
            }
            $setting.Group | % {
            if (!$_.Type) {
                $registry.SetValue($_.name, $_.value)
            }
            else {
                $registry.SetValue($_.name, $_.value, $_.type)
            }
        }
        $registry.Dispose()
        } 
    } catch {
    Write-Host "Failed to pin File Explorer: $_" -ForegroundColor Red
}
    Write-Host "Registry changes applied successfully" -ForegroundColor Green
    Write-Host "Restarting Explorer to apply changes" -ForegroundColor Cyan
    Stop-Process -Name explorer -Force
    Start-Process explorer
    Start-Sleep -Seconds 2
    if ($isColorCustomizationEnabled.Checked) {
        $global:overlayForm.SyncHash.CurrentStatus = "Applying selected color settings..."
        Start-Sleep -Seconds 2
        Write-Host "Setting preferred color settings..." -ForegroundColor Cyan
        Set-PreferredColorSettings
    }
    } catch {
        Write-Host "Error applying registry changes: $_" -ForegroundColor Red
    }
    $global:overlayForm.SyncHash.CurrentStatus = "Classic Windows layout and dark mode applied."
}
# Converts ARGB (AARRGGBB) to ABGR (AABBGGRR) for AccentColor
function ConvertTo-ABGR($color) {
    $A = ($color -shr 24) -band 0xFF
    $R = ($color -shr 16) -band 0xFF
    $G = ($color -shr 8) -band 0xFF
    $B = $color -band 0xFF
    return (($A -shl 24) -bor ($B -shl 16) -bor ($G -shl 8) -bor $R)
}
# Helper function to update registry properties
function Update-RegistryProperty {
    param(
        [string]$Path,
        [string]$PropertyName,
        [string]$PropertyType,
        [object]$Value
    )
    if ($null -eq (Get-ItemProperty -Path $Path -Name $PropertyName -ErrorAction SilentlyContinue)) {
        New-ItemProperty -Path $Path -Name $PropertyName -Value $Value -PropertyType $PropertyType -Force | Out-Null
    } else {
        Set-ItemProperty -Path $Path -Name $PropertyName -Value $Value -Force
    }
}
# Sets the Windows personalisation colour to the preferred selected color
function Set-AccentColor() {
    # Sets the color value based on the selected color
    $Color = $Global:SelectedColor
    # Configuration to navigate through the personalisation colour window
    $CustomColoursButtonTabs = 9
    $MoreDropDownTabs = 2
    $HexcodeFieldTabs = 4
    
    # Convert ARGB back to Color object
    $ColorObj = [System.Drawing.Color]::FromArgb($color)
    
    # Convert to hex code (RRGGBB format)
    $HexCode = "{0:X2}{1:X2}{2:X2}" -f $ColorObj.R, $ColorObj.G, $ColorObj.B

    # Opens the personalisation colour settings windows
    Start-Process "ms-settings:colors"
    # Wait time to for loading in window
    Start-Sleep 3

    # Navigates to the "Custom colours - View colours" button to open the color picker
    [System.Windows.Forms.SendKeys]::SendWait("{TAB $CustomColoursButtonTabs}{ENTER}")
    Start-Sleep 2
    # Navigates to the "More" dropdown and opens it
    [System.Windows.Forms.SendKeys]::SendWait("{TAB $MoreDropDownTabs}{ENTER}")
    Start-Sleep 2
    # Navigates to the hexcode field
    [System.Windows.Forms.SendKeys]::SendWait("{TAB $HexcodeFieldTabs}")
    Start-Sleep 2

    # Selects the current value inside the Hexcode field, paste in the preferred color and applies the color
    $null = [System.Windows.Forms.Clipboard]::SetText($HexCode)
    [System.Windows.Forms.SendKeys]::SendWait("^a")  # Ctrl+A
    Start-Sleep -Milliseconds 300
    [System.Windows.Forms.SendKeys]::SendWait("^v")  # Ctrl+V
    Start-Sleep -Milliseconds 300
    [System.Windows.Forms.SendKeys]::SendWait("{ENTER}")  # Apply

    # Navigates to the "Done" button and confirms the newly set preferred color
    [System.Windows.Forms.SendKeys]::SendWait("{TAB}")
    Start-Sleep -Milliseconds 300
    [System.Windows.Forms.SendKeys]::SendWait("{ENTER}")
    Write-Host "Accent color set to #$HexCode" -ForegroundColor Green
    $global:overlayForm.SyncHash.CurrentStatus = "Preferred color setting applied."
    Start-Sleep -Seconds 2
}
function Set-PreferredColorSettings {
    # Registry paths
    $DWMPath = "HKCU:\Software\Microsoft\Windows\DWM"
    $PersonalizePath = "HKCU:\Software\Microsoft\Windows\CurrentVersion\Themes\Personalize"
    Start-Sleep 1
    Set-AccentColor

    # Set the "Show accent colour on Start and taskbar" enabled if checked
    if ($IsColorSetForStartMenuTaskbarLockScreen.Checked) {
        Update-RegistryProperty -Path $PersonalizePath -PropertyName "ColorPrevalence" -PropertyType "DWORD" -Value 1
    }
    # Set the "Show accent color on title bars and window borders" enabled if checked
    if ($IsColorSetForWindowScreen.Checked) {
        Update-RegistryProperty -Path $DWMPath -PropertyName "ColorPrevalence" -PropertyType "DWORD" -Value 1
    }
    
    # Force the Settings app to reload (if open)
    Stop-Process -Name "SystemSettings" -ErrorAction SilentlyContinue
    Start-Sleep -Seconds 1
}
