    ) -Verb RunAs -WindowStyle Normal -PassThru

    # Wait for the bloatware removal to complete
    $process.WaitForExit()
    
    # Clean up the temporary file
    Remove-Item $tempScript -Force -ErrorAction SilentlyContinue

    $global:overlayForm.SyncHash.CurrentStatus = "Unwanted bloatware successfully removed."
    Start-Sleep -Seconds 2

    $global:overlayForm.SyncHash.CurrentStatus = "Removing Outlook and OneDrive..."
    Start-Sleep -Seconds 2

    Remove-OutlookAndOneDrive

    $global:overlayForm.SyncHash.CurrentStatus = "Removing Microsoft Edge..."
    Start-Sleep -Seconds 2

    Remove-Edge

    $global:overlayForm.SyncHash.CurrentStatus = "Restoring classic Windows layout and applying dark mode..."
    Start-Sleep -Seconds 2

    Set-WindowsClassicLayoutAndDarkMode -browser $browser
}

